import OpenCourse from "../pages/OpenCourse";
import {Link} from "react-router-dom";
import Spider from "../img/SPIDER.jpg"

const CourseTiles=()=>{
    return(

        <Link to="/OpenCourse" >
        <div className="flex m-2 flex-col  h-60 w-74 rounded-xl bg-white border-solid border ">
            <div className=" border-white   w-72 ">
                    <img src={Spider} className=" h-36 w-70 mx-auto my-2 rounded-xl"></img>
            </div>
            <div className=" flex  flex-col h-18 w-72 bg-white border-solid  rounded  border-bo-2 ">
                <h3 className="mx-auto">COURSE 1234</h3>
                <p className="mx-auto mt-6">Data Sturcture</p>
            </div>
        </div>
        </Link>
        
        
    )
}

export default CourseTiles;
